import React from "react";
import styled from "styled-components";

const Education = () => {
  return (
  <Container>

      <h1>Education</h1>
      <ul>

          <li>
              <h2>2014-2017</h2>
              <p>
                  
              Before here, I was study in number of 86  and "HFTML" schools.   In 2014, I was accepted to this school with a  exam. During the my study years , I won various certificates  and appreciation. And I finished secondary school with the good results I collected thanks to my school.
              </p>
          </li>
          <li></li>
          <li></li>
      </ul>
  </Container>
    )
};

export default Education;
const Container = styled.div` 
color: red;
`;
